import React from 'react';

function CharacterCard(character) {
  const { name, image, status, species, origin, location } = character;

  return (
    <div>
      <ul>
        <img src={image} alt={`${bname} image`} />
        <p>{name}</p>
        <li>{status}</li>
        <li>{species}</li>
        <li>{origin}</li>
        <li>{location}</li>
      </ul>
    </div>
  );
}

export default CharacterCard;
